import React from 'react';
// import PropTypes from 'prop-types';
import { useHistory } from 'react-router-dom';

function Header() {
  const history = useHistory();

  return (
    <header className="header">
      <button type="button" onClick={ () => history.push('/') }>
        Home
      </button>
      <button type="button" onClick={ () => history.push('/sobre') }>
        Sobre
      </button>
      <button type="button" onClick={ () => history.push('/skills') }>
        Skills e Conhecimento
      </button>
      <button type="button" onClick={ () => history.push('/contato') }>
        Contato
      </button>
      <button type="button" onClick={ () => history.push('/projetos') }>
        Projetos
      </button>
    </header>
  );
}

export default Header;
